import React from 'react'
import {CardHeader} from "@mui/material";

function About() {
    return (
        <div>
            <h1>About</h1>
            <Card {...props}>
                <CardHeader title="SEARCH FOR PARKING LOTS AND AVAILABLE SPACES" />
                <Box sx={{ minWidth: 800 }}>
                </Box>
            </Card>
        </div>
    )
}

export default About
